ERROR - 2025-03-23 01:09:38 --> Query error: ERROR:  invalid byte sequence for encoding "UTF8": 0xde 0x6e - Invalid query: INSERT INTO "sm_cppt" ("id_layanan_pendaftaran", "waktu", "id_profesi", "subject", "objective", "assessment", "plan", "ademi_assesment", "ademi_diag", "ademi_interv", "ademi_monev", "sbar_situation", "sbar_background", "sbar_assesment", "sbar_recommend", "id_nadis", "ttd_nadis", "instruksi_ppa", "id_dokter_dpjp", "id_user", "konsul_via_telp", "konsul", "created_date") VALUES ('707236', '2025-03-23 06:50', '18', 'tidak dapat dikaji', 'A: Terpasang ETT no. 3 cm Batas Bibir 7,4 cm (09/3/25), suction di ETT warna putih encer, di mulut putih agak kental; B: terintubasi on ventilator Pressure SIMV (rate 40, PIP 14/5 PSV 9 FiO2 25%), SpO2: 92%, RR: 4/menit, desaturasi ada hingga 65Þngan rangsangan; C: CRT kurang dari 3 detik, akral hangat, nadi teraba mulai adekuat, tampak sianonis sentral saat desaturasi, terpasang infus di tangan kiri (22/3/25) untuk obat dan infus di kaki kanan (22/3/25) dengan cairan D10 1/5 NS 7 cc/jam, HR: 143x/menit; E: tampak edema di extremitas atas-bawah hingga labia mayora, kulit tampak lecet pada ekstremitas atas dan bawah, suhu: 37*C, abdomen tampak besar tapi teraba supel, terpasang OGT No. 5/40 (20/03/2025) minum ASi 17-25 cc/3 jam (21 cc), total BAB dalam 24 jam cc, total BAK ada 83 cc, Diuresis 8,7 cc/kgbb/jam, balance cairan 24 jam (-) 14,42 cc/7 jam. BBL: 1290 gr, BB: 1.7200 gram, lingkar perut 28, lingkar kepala 25, Panjang badan 40 cm. Hasil lab 19/03/25: Hb 11.8 / HT 32 / Leukosit 17.3 / Trombosit 476, hasil kultur darah (20/03/2025): "staphylococcus haemolyticus", hasil AGD (20/03/25): pH 7.364 / pCO2 43.8 / pO2 62 / tCO2 26.7 / BE -0.3 / HCO3 25 / Saturasi 90. Hasil echo (17/3/25): PDA sedang - besar', 'Gangguan ventilasi spontan, Menyusui tidak efektif, penurunan curah jantung', 'Setelah dilakukan tindakan keperawatan selama 7x24 jam diharapakan ventilasi spontan meningkat dengan kriteria hasil: penggunaan otot bantu nafas menurun, gelisah menurun, dispneu menurun, takikardi membaik, PO2 membaik; Setelah dilakukan perawatan 7x24 jam diharapkan status menyusui membaik dengan kriteria hasil : Perlekatan bayi pada payudara ibu meningkat, Kemampuan ibu memposisikan bayi meningkat, Hisapan bayi meningkat, Bayi rewel menurun. Setelah dilakukan perawatan 7x24 jam, diharapkan curah jantung meningkat dengan Kriteria Hasil : kekuatan nadi perifer meningkat, bradikardi menurun, edema menurun, dispnoe menurun, pucat/sianosis menurun, murmur jantung menurun', '', '', '', '', '', '', '', '', '1685', '1', 'Intervensi Keperawatan: Monitor adanya kelelahan otot bantu nafas, Monitor status respirasi dan oksigenisasi, Pertahankan kepatenan jalan nafas, Bantu untuk merubah posisi jika diperlukan, Lakukan auskultasi bunyi pernafasan secara teratur, Identifikasi keadaan emosional ibu saat akan dilakukan konseling menyusui, Identifikasi keinginan dan tujuan menyusui, Identifikasi permasalahan yang ibu alami selama proses menyusui, Berikan informasi dan saran menyusui yang benar sesuai kebutuhan ibu, Identifikasi tanda dan gejala primer penurunan curah jantung (meliputi dispnoe, kelelahan, edema, orthopnoe, paroxysmal nocturnal dyspnoe, peningkatan CVP), Monitor intake dan output cairan, Monitor saturasi oksigen, Posisikan pasien semi-fowler atau fowler dengan kaki ke bawah atau posisi nyaman, Kolaborasi pemberian oksigen untuk mempertahankan saturasi oksigen &gt;94 %<div></div><div>Kolaborasi: post tranfusi FFP 2 kali selesai terakhir 13/03/25 jam 00.30, weaning setting venti bertahap, minum 17 - 25 cc/3jam, post tranfusi PRC 2x12 cc selesai tanggal 18/3/25 jam 17.10 WIB, terapi Paracetamol drip 12,2 mg/6jam (diberikan sampai dengan pasien dipulangkan), rencana evaluasi echokardiografi 1 bulan kemudian</div>', NULL, '1685', 0, NULL, '2025-03-23 01:09:38')
